UPDATE etfs_ativos_reais 
    SET dividends_12m = CASE symbol
        WHEN 'SPUS' THEN 0.104 WHEN 'JGRW' THEN 0.158 WHEN 'GSY' THEN 0.966 WHEN 'PSCF' THEN 1.403 WHEN 'EWC' THEN 1.691 WHEN 'ARKK' THEN 3.3819999999999997 WHEN 'WBIL' THEN 0.34900000000000003 WHEN 'ACSI' THEN 1.425 WHEN 'VCLT' THEN 1.3850000000000002 WHEN 'TAXX' THEN 0.617 WHEN 'BBSC' THEN 0.8340000000000001 WHEN 'YBTC' THEN 1.0710000000000002 WHEN 'BLCN' THEN 0.207 WHEN 'VFH' THEN 2.182 WHEN 'WEBS' THEN 1.755 WHEN 'TEKX' THEN 0.97 WHEN 'IQSI' THEN 0.836 WHEN 'GRNB' THEN 0.33399999999999996 WHEN 'RSPN' THEN 0.507 WHEN 'AIVC' THEN 0.228
    END,
    updatedat = NOW()
    WHERE symbol IN ('SPUS', 'JGRW', 'GSY', 'PSCF', 'EWC', 'ARKK', 'WBIL', 'ACSI', 'VCLT', 'TAXX', 'BBSC', 'YBTC', 'BLCN', 'VFH', 'WEBS', 'TEKX', 'IQSI', 'GRNB', 'RSPN', 'AIVC');